export var symmetry_gql = /* GraphQL */ "\nquery AssemblySymmetry($assembly_id: String!, $entry_id: String!) {\n    assembly(assembly_id: $assembly_id, entry_id: $entry_id) {\n        rcsb_struct_symmetry {\n            clusters {\n                avg_rmsd\n                members {\n                    asym_id\n                    pdbx_struct_oper_list_ids\n                }\n            }\n            kind\n            oligomeric_state\n            rotation_axes {\n                order\n                start\n                end\n            }\n            stoichiometry\n            symbol\n            type\n        }\n    }\n}\n";
